import TodoApp from "./TodoApp";

const divStyle = {
  backgroundImage: `url(${background})`,
  backgroundSize: "cover",

  //width: "1200px",
  height: "800px",
  border: "0px",
  marginTop: "-80px",
}

var todoItems = [];

function App(){
  return (
    <div className="App">
      <div style={divStyle}>
        <div>
          {<TodoApp initItems={todoItems} />}

        </div>
      </div>
    </div>
  );
}

export default App;
